import React from 'react'
import './App.css'
import Home from './Pages/Home'
import Blog from './Pages/Blog'
import {Route} from 'react-router-dom'



const App = () => {
  return (
    <div>
      <Route path="../" component={Home}/>
      <Route path="/blog/:id" component={Blog}/>
    </div>
  )
}

export default App;
